import React from "react";

import User from "./User/User";
function App() {
  return (
    <div
      style={{
        width: "100%",
      }}
    >
      <User name="Max" age="34" />
      <User name="Sam" age="28">
        My Favorite Things: Swiming, Racing
      </User>
      <User name="Joshua" age="21" />
    </div>
  );
}

export default App;
